import { BrowserRouter } from 'react-router-dom';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <header>
        <Menu />
      </header>
      <main>
        <Container></Container>
      </main>

    </div>
    </BrowserRouter>    
  );
}

export default App;
